-- ======================
-- ART BUFFER
-- ======================
local art = {}
for i = 1, TOTAL do art[i] = "FFFFFF" end

-- ======================
-- PARSER DE MAP
-- ======================
local function parseTextToArt(text)
    for i = 1, TOTAL do art[i] = "FFFFFF" end
    if not text then return 0 end
    local count = 0
    for idx, hex in text:gmatch("Pixel%s+(%d+).-=%s*([A-Fa-f0-9]+)") do
        local n = tonumber(idx)
        if n and n >= 1 and n <= TOTAL then
            art[n] = hex:upper()
            count = count + 1
        end
    end
    return count
end

